import message from './Dialogs.module.css';
import {NavLink} from 'react-router-dom';


function DialogItem(props) {
    let path = "/dialogs/" + props.id;
    return (
        <NavLink  className={message.dialogs_item_user} to={path}>{props.name}</NavLink>
    );
}

function Message(props) {
    return(
        <div className={message.message_item}>{props.content}</div>
    );
}

function Dialogs() {
    return(
        <div className={message.dialogs}>
            <div className={message.notify}>

                    <DialogItem name={'Dimych'} id={'1'}/>
                    <DialogItem name={'Evgeniy'} id={'2'}/>
                    <DialogItem name={'Sasha'} id={'3'}/>
                
            </div>
            <div className={message.paper_dial}>
                <Message content={'Hello'}/>
                <Message content={'How are you?'}/>
                <Message content={'Chel'}/>
            </div>
        </div>
    );
}

export default Dialogs
